package coreJavaToken;

public class forLoopAssignment {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i=1;i<=100;i++)
		{
			System.out.println(i);
		}
		for (int i=-50;i<=-41;i++)
		{
			System.out.println(i);
		}
		for (int i=9;i<=90;i++)
		{
			System.out.println(i);
		}
		for (int i=1;i<0;i++)
		{
			System.out.println(i);
		}
		for (int i=1;i<0;i--)
		{
			System.out.println(i);
		}
		
		
		
		
		
	}

}
